import React, { Component } from 'react';

class Table extends Component {
    constructor(props) {
        super(props);
        this.state = { 
            count: 0,
            tags: ['tag1', 'tag2', 'tag3']
         }
    }
    render() { 
        return (
            <React.Fragment>
                <span className='badge bg-primary m-2'>{ this.state.count }</span>
                <button
                    onClick={this.handleIncrement} className='btn btn-secondary btn-sm'>++</button>
                <ul>
                    { this.state.tags.map(tag => <li key={tag}>{tag}</li>) }
                </ul>
            </React.Fragment>
        );

    }
}

export default Table;
